import './App.css';
import BoggleLogo from './images/logo.png';

function App() {
  return (
    <Grid fluid id='app'>
      <Row>
        <img src={BoggleLogo} className='center-align' />
      </Row>
      <Row>
        <div className='center-align'>
        Current Word, Submit Button
        </div>
      </Row>
      <Row>

      </Row>
      <Row>
        <Col xs={1} sm={1} md={2} lg={2}/>
      <div id='board'>
        <div class='row'>

          <div class='char'>
            asdfasdf
          </div>
        </div>
      </div>
      <div id='score-table'></div>
      </Row>


    </Grid>
  );
}

export default App;
